To draw a chessboard in LaTeX, you can use the `tikz` package, which is very powerful for creating diagrams and graphics. Below is an example of a LATEX code that includes the necessary commands and packages to draw a chessboard using FEN notation:

```latex
\documentclass{article}
\usepackage{tikz}

\begin{document}

\begin{tikzpicture}
  \foreach \r in {1,2,3,4,5,6,7,8,9} {
    \foreach \c in {1,2,3,4,5,6,7,8,9} {
      \fill (\r.\c) rectangle ++(1,2) -- (\r.\c+1,2) -- (\r.\c+1,1) -- (\r.\c+1,2);
    }
  }
\end{tikzpicture}

\end{document}
```

Here's a brief explanation of the code:
- `\documentclass{article}`: Specifies the document class.
- `\usepackage{tikz}`: Imports the TikZ package, which is essential for drawing.
- `\begin{tikzpicture}` and `\end{tikzpicture}`: Defines a TikZ environment, which is used to draw the chessboard.
- `\foreach \r in {1,2,3,4,5,6,7,8,9}`: Loops through each rank (row) of the chessboard.
- `\foreach \c in {1,2,3,4,5,6,7,8,9}`: Loops through each file (column) of the chessboard.
- `\fill (\r.\c) rectangle ++(1,2) -- (\r.\c+1,2) -- (\r.\c+1,1) -- (\r.\c+1,2)`: Fills the cells with a black color and draws the lines connecting the cells.

